The equation of a circle with center $(a,b)$ and radius $r$ is given by

\[(x-a)^2+(y-b)^2=r^2.\]

We can rewrite our equation in this form as follows:

\begin{align*}

x^2+y^2&=14x+48y\\

x^2-14x+y^2-48y&=0\\

(x-7)^2+(y-24)^2&=625.

\end{align*}This tells us that the circle has center $(7,24)$ and radius $25$. The maximum value of $y$ occurs when we are on the uppermost point of this circle. Let's label the points on the circumference as follows:

The line connecting these two points will be perpendicular to the horizontal axis because it is tangent to the circle. Therefore, it has slope $\frac{0-4}{1-\sqrt{14}}=\frac{-4}{1-\sqrt{14}}$. If $y$-coordinate is $24$, then we have \begin{align*}

\text{slope}&=\frac{\Delta y}{\Delta x}=\frac{\text{slope of line }(x,y)}{\text{slope of radius }(x,y)\\

&=\frac{-4}{1-\sqrt{14}}\\

y-24&=-\frac{4(24-x)}{1-\sqrt{14}(x-7)}

\end{align*}Now, let's solve for $y$.

\begin{align*}

y-24&=-\frac{4(24-x)}{1-\sqrt{14}(x-7)}\\

y&=24+\left(\frac{-96+4x}{1-\sqrt{14}(x-7)}\right)

\end{align*}We can multiply the numerator and denominator of this expression by $\sqrt{14}$ to simplify it:

\begin{align*}

y&=24+\left(\frac{-96\cdot \sqrt{14}+4x \cdot \sqrt{14}}{\sqrt{14}-14(x-7)}\right)\\

y&=24+\left(\frac{(-96)\sqrt{14}+4x \cdot \sqrt{14}}{\sqrt{14}-\sqrt{14}\left( x-7\right)}\right)

\end{align*}We can factor $\sqrt{14}$ from the numerator and denominator:

\begin{align*}

y&=24+\frac{\left((-96)\sqrt{14}+4x \cdot \sqrt{14}\right)/\sqrt{14}}{\left(\sqrt{14}-14(x-7)\right)/\sqrt{14}}

\end{align*}Now, we can simplify the fraction by dividing the numerator and denominator of the top fraction by $\sqrt{14}$:

\begin{align*}

y&=24+\frac{\left(-96+4x\right)}{\sqrt{14}-14(x-7)}

\end{align*}If $x$ is $0$, then we have \begin{align*}

y&=24+\frac{-96}{-\sqrt{14}}\\

&=\frac{3(8)(2)\sqrt{14}-24}{1}\\

&=\boxed{\textbf{(B) } 40}.

\end{align*}
